import React from 'react';
import PropTypes from 'prop-types';

function HeightAndWidth({ handles }) {
  console.log(handles);
  const { handleHeight, handleWidth } = handles;
  return(
    <div>
      <label htmlFor="height">
      altura
      <input
        type="number"
        id="height"
        value="height"
        onChange={ handleHeight }
      />
      </label>
      <label htmlFor="width">
        largura
        <input
          type="number"
          id="width"
          value="width"
          onChange={ handleWidth }
        />
      </label>
    </div>
  );
}

HeightAndWidth.propTypes = {
  handles: PropTypes.object,
};

export default HeightAndWidth;
